const Items = ({ items, setItems, ondelete }) => {
  const [searchitem, setsearchitem] = useState("");
  return (
    <div>
      <input
        type="search"
        placeholder="search Item"
        onChange={(e) => setsearchitem(e.target.value)}
      />
      {items.filter((t) =>
        searchItems(t.name.toLowerCase().includes(searchitem.toLowerCase()))
      )}
      {items.map((item) => (
        <h3>
          {item.name}
          <button onClick={() => ondelete(item)}>Delete</button>
        </h3>
      ))}
    </div>
  );
};
export default Items;
